We can extend existing structures by adding new fields. This feature allow us to simulate a form of inheritance . structure Point (α : Type u) where x : α y : α inductive Color where | red | green | blue structure ColorPoint (α : Type u) extends Point α where color : Color #check { x := 10, y := 20, color := Color.red : ColorPoint Nat }
-- { toPoint := { x := 10, y := 20 }, color := Color.red } The output for the check command above suggests how Lean encoded inheritance and multiple inheritance. Lean uses fields to each parent structure. structure Foo where x : Nat y : Nat structure Boo where w : Nat z : Nat structure Bla extends Foo, Boo where bit : Bool #check Bla.mk -- Foo → Boo → Bool → Bla
#check Bla.mk { x := 10, y := 20 } { w := 30, z := 40 } true
#check { x := 10, y := 20, w := 30, z := 40, bit := true : Bla }
#check { toFoo := { x := 10, y := 20 }, toBoo := { w := 30, z := 40 }, bit := true : Bla } theorem ex : Bla.mk { x := x, y := y } { w := w, z := z } b = { x := x, y := y, w := w, z := z, bit := b } := rfl

